function convertToPythonList(allPokemons, fields) {
    let pythonList = [];
    for (const pokemonKey in allPokemons) {
        const pokemon = allPokemons[pokemonKey];
        let pokemonData = {};
        fields.forEach(field => {
            if (pokemon[field] !== undefined) {
                pokemonData[field] = typeof pokemon[field] === 'object' ? JSON.stringify(pokemon[field]) : pokemon[field];
            }
        });
        pythonList.push(pokemonData);
    }
    return pythonList;
}

