function randomPokemonSet(team, num, visual) {
    function getRandomObject(object) {
        var keys = Object.keys(object);
        var randomKey = keys[Math.floor(Math.random() * keys.length)];
        return object[randomKey];
    }
    while (true) {
        var randomPokemon = getRandomObject(allPokemons);
        if (randomPokemon.num > -1 && randomPokemon.num < 906 && !randomPokemon.forme && randomPokemon.prevo && !randomPokemon.evos) {
            break;
        }
    }

    team[num].name = randomPokemon.name;
    team[num].moves = [{}, {}, {}, {}]
    for (let i = 0; i < 4; i++) {
        while (true) {
            randomMove = getRandomObject(allMoves)
            if (!randomMove.name.includes('G-Max')) {
                team[num].moves[i].name = randomMove.name;
                break;
            }
        }
    }
    team[num].item = {}
    while (true) {
        randomItem = getRandomObject(allItems)
        if (!randomItem.name.includes('TR') && !randomItem.name.includes('Ball')) {
            team[num].item.name = randomItem.name
            break;
        }
    }
    team[num].ability = {}

    randomAbility = getRandomObject(randomPokemon.abilities)

    team[num].ability.name = randomAbility

    team[num].boosts = {
        atk: 0,
        def: 0,
        spa: 0,
        spd: 0,
        spe: 0,
    };
    pokemonsParam(team)
    movesParam(team)
    abilitiesParam(team)
    itemsParam(team)
    pokemonStatsLoad(team)
    pokemonInfoChange(team[num], visual)
}

