function damage_calculate(playerPokemon, move, targetPokemon, weather = 1, targets = 1, critical = 1) {
    stab = 1;

    console.log(playerPokemon)


    if (activePokemon.types.includes(move.type)) {
        stab = 1.5;
    }

    typeEffect = typeEffectiveness[move.type.toLowerCase()][targetPokemon.types[0].toLowerCase()];

    if (targetPokemon.types.length == 2) {
        typeEffect *= typeEffectiveness[move.type.toLowerCase()][targetPokemon.types[1].toLowerCase()];
    }

    burn = 1;

    if (playerPokemon.status == 'brn') {
        burn = 0.5
    }


    other = 1;

    function getRandomInRange(min, max) {
        return Math.random() * (max - min) + min;
    }

    var random = getRandomInRange(0.85, 1);

    if (move.category == "Physical") {
        if (playerPokemon.boosts.atk >= 0) {
            attackStat = playerPokemon.stats.atk * (playerPokemon.boosts.atk + 2) / 2;
        }
        else {
            attackStat = (playerPokemon.stats.atk / ((-(playerPokemon.boosts.atk) + 2) / 2))
        }
        if (targetPokemon.boosts.def >= 0) {
            defenseStat = targetPokemon.stats.def * (targetPokemon.boosts.def + 2) / 2;
        }
        else {
            defenseStat = (targetPokemon.stats.def / ((-(targetPokemon.boosts.def) + 2) / 2))
        }
    }
    else if (move.category == "Special") {
        if (playerPokemon.boosts.spa >= 0) {
            attackStat = playerPokemon.stats.spa * (playerPokemon.boosts.spa + 2) / 2;
        }
        else {
            attackStat = (playerPokemon.stats.spa / ((-(playerPokemon.boosts.spa) + 2) / 2))
        }
        if (targetPokemon.boosts.spd >= 0) {
            defenseStat = targetPokemon.stats.spd * (targetPokemon.boosts.spd + 2) / 2;
        }
        else {
            defenseStat = (targetPokemon.stats.spd / ((-(targetPokemon.boosts.spd) + 2) / 2))
        }
    }
    attackStat = Math.floor(attackStat)
    defenseStat = Math.floor(defenseStat)

    damage = ((((2 * playerPokemon.level / 5 + 2) * (move.basePower * burn) * (attackStat / defenseStat)) / 50 + 2) * targets * weather * critical * random * stab * typeEffect * other).toFixed();

    return damage;
}

function damage_to_pokemon(attackPokemon, targetPokemon, move, num) {

    function isDigit(character) {
        return !isNaN(parseInt(character));
    }
    console.log(move)

    if (isDigit(move.accuracy)) {
        if (Math.floor(Math.random() * 100) > move.accuracy) {
            showMissMessage("Miss!", num);
            battleLog(attackPokemon.name + " missed")
            return
        }
    }
    battleLog(attackPokemon.name + " used " + move.name)

    console.log(move.basePower)
    if (move.basePower > 0) {
        damage = damage_calculate(attackPokemon, move, targetPokemon);
        targetPokemon.hp -= damage;
    }
    else if (move.multihit) {
        hitsValue = getRandomNumber(move.multihit[0], move.multihit[1]);
        for (let i = move.multihit[0]; i < hitsValue; i++) {
            targetPokemon.hp -= damage_calculate(attackPokemon, move, targetPokemon);
        }
        console.log("Multihit: " + hitsValue);
    }
    else {
        damage = 0;
    }

    function getRandomNumber(min, max) {
        return Math.floor(Math.random() * (max - min + 1)) + min;
    }

    secondary = move.secondary
    if (secondary) {
        if (getRandomNumber(1, 100) <= (secondary.chance)) {
            if (secondary.self) {
                for (var stat in secondary.self.boosts) {
                    if (secondary.self.boosts.hasOwnProperty(stat)) {
                        var boostValue = secondary.self.boosts[stat];
                        if (attackPokemon.boosts[stat] < 6 && -6 < attackPokemon.boosts[stat]) {
                            attackPokemon.boosts[stat] += boostValue;
                        }
                    }
                }
            }
            if (secondary.status && !targetPokemon.status && !targetPokemon.types.includes(statuses[secondary.status.toLowerCase()].exceptions)) {
                statusSet(secondary.status, num);
            }
            if (secondary.boosts) {
                boosts = secondary.boosts;
                for (var stat in boosts) {
                    if (boosts.hasOwnProperty(stat)) {
                        var boostValue = boosts[stat];
                        if (targetPokemon.boosts[stat] < 6 && -6 < targetPokemon.boosts[stat]) {
                            targetPokemon.boosts[stat] += boostValue;
                        }
                    }
                }
            }
        }

    }

    if (move.status && !targetPokemon.status) {
        statusSet(move.status, num);
    }
    console.log(damage)

    if (damage) {
        if (move.recoil) {
            recoilValue = Math.floor(damage * move.recoil[0] / move.recoil[1]);
            attackPokemon.hp -= recoilValue;
            battleLog("Recoiled: " + recoilValue);
        }
        if (move.drain) {
            healValue = Math.floor(damage * move.drain[0] / move.drain[1])
            attackPokemon.hp += healValue;
            battleLog("Drained: " + healValue);
        }
    }


    if (move.heal) {
        attackPokemon.hp += Math.floor(attackPokemon.stats.hp * move.heal[0] / move.heal[1])
    }

    boosts = move.boosts;
    for (var stat in boosts) {
        if (boosts.hasOwnProperty(stat)) {
            var boostValue = boosts[stat];
            if (attackPokemon.boosts[stat] < 6 && -6 < attackPokemon.boosts[stat]) {
                attackPokemon.boosts[stat] += boostValue;
            }
        }
    }
    if (move.self) {
        selfBoosts = move.self.boosts
        for (var stat in selfBoosts) {
            if (selfBoosts.hasOwnProperty(stat)) {
                var boostValue = selfBoosts[stat];
                if (attackPokemon.boosts[stat] < 6 && -6 < attackPokemon.boosts[stat]) {
                    attackPokemon.boosts[stat] += boostValue;
                }
            }
        }
    }
    if (move.selfBoost) {
        selfBoost = move.selfBoost.boosts
        for (var stat in selfBoost) {
            if (selfBoost.hasOwnProperty(stat)) {
                var boostValue = selfBoost[stat];
                if (attackPokemon.boosts[stat] < 6 && -6 < attackPokemon.boosts[stat]) {
                    attackPokemon.boosts[stat] += boostValue;
                }
            }
        }
    }


    if (num == 0) {
        if (move.selfSwitch) {
            openSelection('Yes');
        }
    }
    else {
        if (move.selfSwitch) {
            opponentPokemonSwap();
        }
    }

    if (attackPokemon.hp > attackPokemon.stats.hp) {
        attackPokemon.hp = attackPokemon.stats.hp;
    }

    if (attackPokemon.hp <= 0) {
        attackPokemon.hp = 0;
    }
    if (targetPokemon.hp <= 0) {
        targetPokemon.hp = 0;
    }

    if (num == 1) {
        if (attackPokemon.hp == 0) {
            opponentPokemonSwap();
        }
    }

}
