function checkToSpace(text) {
    var textWords = text.split(' ');
    var newText = '';
    for (var z = 0; z < textWords.length; z++) {
        newText += textWords[z];
        if (textWords[z + 1]) {
            newText += ' ';
        }
    }
    return newText
}

